import React from 'react';
import  {add, sub} from './Calc';


function App(){
return(
    <>
    <h1 className = "heading">Calculate Amount :)</h1>,
    <h2>Add : {add(60,4)}</h2>
    <h2>Add : {sub(60,4)}</h2>
    </>
);
}

export default App;
